const getData = (filters = {}) => {
  const page_size = parseInt(filters?.page_size || 20, 10);
  const page = parseInt(filters?.page || 1, 10);
  const type = parseInt(filters?.type || 0, 10);
  const keyword = filters?.keyword || "";
  const tag = filters?.tag || "";

  // Apply a few filters
  let results = list;

  if (tag) {
    results = results.filter((item) => item.tags.indexOf(`${tag}`) >= 0);
  }

  if (type) {
    results = results.filter((item) => item.type === type);
  }
  if (keyword) {
    const keyLow = normalizeString(keyword);

    results = results.filter((item) => {
      return normalizeString(item?.title || "").indexOf(keyLow) >= 0;
    });
  }

  const { dirOrder, keyOrder } = (() => {
    const order = filters?.order || "none";
    if (order === "none") {
      return { dirOrder: 1, keyOrder: null };
    }
    return {
      dirOrder: order.indexOf("-") === 0 ? -1 : 1,
      keyOrder: order.indexOf("-") === 0 ? order.substring(1) : order,
    };
  })();

  if (results[0] && keyOrder && results[0][keyOrder]) {
    results = results.sort((a, b) =>
      a[keyOrder] < b[keyOrder] ? -1 * dirOrder : 1 * dirOrder
    );
  }

  const resultPaginated = results.slice(
    page_size * (page - 1),
    page_size * page
  );

  ///////////////

  return {
    count: results.length,
    current: page,
    results: resultPaginated,
  };
};
export default getData;
